import React from 'react';
import './Header.css';
import Navigation from './Navigation';
import Logo from './logo.png';

export default props => {
    return(
        <div className="header">
            <Navigation />

            <div className="logo-right">
                <img src={Logo} height="75px" width="75px" />
            </div>
        </div>
    )
}
